import axios from 'axios';

const API_URL = 'http://localhost:8080/api/';

class AuthenticationService {

    register(username, password) {
        console.log(username);
        return axios.post(`${API_URL}/`, {
            username,
            password
        })
    }
}

export default new AuthenticationService()
